    comboBox->cbButton->setColour(TextButton::buttonOnColourId , Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
    comboBox->cbButton->setColour(TextButton::textColourOffId , Colour::greyLevel(1.0f));
    comboBox->cbButton->setColour(TextButton::textColourOnId , Colour::greyLevel(1.0f));
    comboBox->cbButton->setColour(TextButton::buttonColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
